import React, { useState, useMemo, useEffect } from "react";
import { useQuery } from "@tanstack/react-query";
import Axios from "axios";
import PropTypes from "prop-types";
import "tailwindcss/tailwind.css";

import BackgroundImage from "../components/ui/BackgroundImage";
import CardsContainer from "../components/ui/CardComponents/CardsContainer";
import SmallCard from "../components/ui/CardComponents/SmallCard";
import Loader from "../components/ui/Loader";
import Error from "./errors/Error";
import Pagination from "../components/ui/Pagination";

function Home({ searchTerm, openBigCard }) {
  const [page, setPage] = useState(1);
  const [sortedPokemonData, setSortedPokemonData] = useState([]);
  const limit = 100;

  const [heightFilter, setHeightFilter] = useState(null);
  const [weightFilter, setWeightFilter] = useState(null);
  const [sortOption, setSortOption] = useState(null);

  const fetchPokemon = async () => {
    const url = searchTerm
      ? `https://pokeapi.co/api/v2/pokemon/${searchTerm.toLowerCase()}`
      : `https://pokeapi.co/api/v2/pokemon?offset=${(page - 1) * limit}&limit=${limit}`;

    const response = await Axios.get(url);
    let data = searchTerm
      ? [response.data]
      : await Promise.all(response.data.results.map((result) => Axios.get(result.url))).then((responses) =>
          responses.map((res) => res.data)
        );

    // Apply the filters here
    if (heightFilter === "taller100cm") {
      data = data.filter((pokemon) => pokemon.height >= 10);
    } else if (heightFilter === "shorter100cm") {
      data = data.filter((pokemon) => pokemon.height < 10);
    }
    if (weightFilter === "0-10kg") {
      data = data.filter((pokemon) => pokemon.weight > 0 && pokemon.weight <= 100);
    } else if (weightFilter === "11-50kg") {
      data = data.filter((pokemon) => pokemon.weight > 100 && pokemon.weight <= 500);
    } else if (weightFilter === "more50kg") {
      data = data.filter((pokemon) => pokemon.weight > 500);
    }

    return data;
  };

  const {
    data: pokemonData,
    isLoading,
    isError,
  } = useQuery(["pokemon", searchTerm, heightFilter, weightFilter, page], fetchPokemon);

  useEffect(() => {
    if (pokemonData) {
      let sortedData = [...pokemonData];

      switch (sortOption) {
        case "heightDesc":
          sortedData.sort((a, b) => b.height - a.height);
          break;
        case "heightAsc":
          sortedData.sort((a, b) => a.height - b.height);
          break;
        case "weightDesc":
          sortedData.sort((a, b) => b.weight - a.weight);
          break;
        case "weightAsc":
          sortedData.sort((a, b) => a.weight - b.weight);
          break;
        default:
          break;
      }

      setSortedPokemonData(sortedData);
    }
  }, [pokemonData, sortOption]);

  const getSprite = useMemo(
    () => (data) => {
      if (data?.id >= 906 && data?.id <= 1008) {
        return data.sprites.other["official-artwork"]["front_default"];
      } else if (data?.id < 1009) {
        return data.sprites.other.home.front_default;
      }
    },
    []
  );

  return (
    <>
      <BackgroundImage />
      <div className="absolute top-0 left-0 w-full h-full overflow-y-auto">
        {isLoading ? (
          <Loader />
        ) : isError ? (
          <Error message="An error occurred while loading Pokemon data." />
        ) : (
          <>
            <CardsContainer
              heightFilter={heightFilter}
              setHeightFilter={setHeightFilter}
              weightFilter={weightFilter}
              setWeightFilter={setWeightFilter}
              sortOption={sortOption}
              setSortOption={setSortOption}
            >
              {sortedPokemonData.map((pokemon) => (
                <SmallCard
                  key={pokemon.id}
                  name={pokemon.name}
                  id={pokemon.id}
                  img={getSprite(pokemon)}
                  onClick={() => openBigCard(pokemon)}
                />
              ))}
            </CardsContainer>
            <Pagination
              page={page}
              setPage={setPage}
              hasPreviousPage={page > 1}
              hasNextPage={pokemonData.length === limit}
            />
          </>
        )}
      </div>
    </>
  );
}

Home.propTypes = {
  searchTerm: PropTypes.string,
  sortOption: PropTypes.string,
  openBigCard: PropTypes.func.isRequired,
};

export default Home;
